    false,nt"url": null,nt"notes": "This annual narrative report for Roanoke
    River National Wildlife Refuge summarizes Refuge activities during the 1991 calendar
    year.  The report begins with a summary of the yearu2019s highlights and climatic
    conditions.  Land acquisition is also covered.  The report includes a planning section
    which discusses the management plan, research, and investigations.  Refuge administration
    is outlined; information about personnel, volunteer programs, funding, safety, and
    technical assistance is given.  Habitat management is also covered.  Subjects include
    wetlands, fire management, water rights, and Farmeru2019s Home Administration Conservation
    Easements.  The wildlife section of the report discusses wildlife diversity, waterfowl,
    marsh birds, water birds, raptors, game mammals, fisheries resources, and marking/banding.
     The public uses of the Refuge described in this report include interpretive programs,
    hunting, camping, and law enforcement.  The equipment and facilities section of
    the report provides information about equipment utilization/replacement and computer
    systems.  Items of interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
